import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { Navigation } from './navigation';
import { StartScreen } from '../screens/startScreen';
import { HomeScreen } from '../screens/homeScreen';
import { SettingsScreen } from '../screens/settingsScreen';

const Stack = createNativeStackNavigator();

export const AppStack = () => {
    return (
        <Stack.Navigator initialRouteName={Navigation.Start} screenOptions={{ headerShown: false}}>
            <Stack.Screen name={Navigation.Start} component={StartScreen} />
            <Stack.Screen name={Navigation.Home} component={HomeScreen} />
            <Stack.Screen name={Navigation.Settings} component={SettingsScreen} />
        </Stack.Navigator>
    );
}
